    def maxPossibleScore(self, start: List[int], d: int) -> int:
        start.sort()
        ranges = [[s, s+d] for s in start]
        score_range = []
        # print(ranges)
        for r in range(1, len(ranges)):
            score_range.append(ranges[r][1] - ranges[r-1][0])
            score_range.append(ranges[r][0] - ranges[r-1][1])
        # print(score_range)

        min_score = min(score_range)
        max_score = max(score_range)
        ans = 0
        low, high = max(min_score, 1), max_score + 1
        while low < high:
            # print(low, high)
            tmp_score = (low + high) // 2
            # check valid?
            stack = [ranges[0][0]]
            cnt = 1
            # print("tmp_score", tmp_score)
            break_flag = False
            while cnt != len(ranges):
                if ranges[cnt][0] <= stack[-1] + tmp_score <= ranges[cnt][1]:
                    stack.append(stack[-1] + tmp_score)
                    cnt += 1
                elif stack[-1] + tmp_score < ranges[cnt][0]:
                    stack.append(ranges[cnt][0])
                    cnt += 1
                else:
                    # for i in range(len(stack)):
                    #     if ranges[i][0] <= stack[i] + 1 <= ranges[i][1]:
                    #         stack[i] += 1
                    #     else:
                    #         break_flag = True
                    #         break
                    # if break_flag:
                    #     break

                    # binary search
                    stack.append(stack[-1] + tmp_score)   

                    tmp_flag = False                 
                    l, h = 1, d
                    while l < h:
                        m = (l+h)//2
                        for i in range(len(stack)):
                            if not (ranges[i][0] <= stack[i] + m <= ranges[i][1]):
                                tmp_flag = True
                                break
                        if tmp_flag:
                            h = m
                        else:
                            l = m + 1

                    for i in range(len(stack)):
                        if ranges[i][0] <= stack[i] + l <= ranges[i][1]:
                            stack[i] += l
                        else:
                            break_flag = True
                            break
                    if break_flag:
                        break
                    else:
                        cnt += 1

                # if high == 954:
                #     print("stack", stack)
            if break_flag:
                high = tmp_score
            else:
                low = tmp_score + 1
            if cnt == len(ranges):
                ans = max(ans, tmp_score)
        # print(ans, high)
        return ans

    def maxPossibleScore(self, start: List[int], d: int) -> int:
        start.sort()

        ans = 0
        low, high = 1, start[-1] + d - start[0] + 1
        while low < high:
            print(low, high)
            tmp_score = math.ceil((low + high) / 2)
            # tmp_score = math.floor((low + high) / 2)

            flag = True
            last = start[0]
            for s in range(1, len(start)):
                if last + tmp_score > start[s] + d:
                    flag = False
                else:
                    last = max(last + tmp_score, start[s])
            # if not flag:
            #     high = tmp_score
            # else:
            #     low = tmp_score + 1
            #     ans = max(ans, tmp_score)
            
            if flag:
                low = tmp_score
            else:
                high = tmp_score - 1
        return low


